import React from "react";
import NewNote from './NewNote';
import Note from "./Note";
import notesData from "../../notes-data";

function generateNote(note) {
    return <Note
        key={note.id}
        noteHeader={note.h}
        noteContent={note.p}
    />
}

function Notes() {
  return (
    <div>
        <NewNote />
        {notesData.map(generateNote)}
    </div>
  );
}

export default Notes;
